import React from 'react'
import {
    Box,
    Flex
} from 'rebass';
import '../App.css'

class Footer extends React.Component {
    render() {
        return (
            <Flex
                className="Footer"
                px={2}
                py={2}
                color='white'
                bg='black'
                alignItems='center'>
                    Copyright
                {/* <Box mx='auto' /> */}
            </Flex>
        )
    }
}

export default Footer
